#import <Foundation/Foundation.h>

bool allUnique(char * s,int start,int end){
    int table[256]={0};
    for (int i=start; i<end; i++) {
        int m = table[s[i]];
        if (m==1) {
            return NO;
        }
        table[s[i]]=1;
    }
    
    return YES;
}

int lengthOfLongestSubstring1(char * s){
    int n =strlen(s);
    int ans = 0;
    for (int i = 0; i < n; i++){
        for (int j = i + 1; j <= n; j++){
            if (allUnique(s, i, j)) {
                if (ans<j-i) {
                    ans = j-i;
                }
            }
        }
    }
    return ans;
}

int lengthOfLongestSubstring2(char * s){
     int n =strlen(s);
    int ans = 0, i = 0, j = 0;
     int table[256]={0};
    while (i < n && j < n) {
          int m = table[s[j]];
        // try to extend the range [i, j]
        if (m==0){
           table[s[j]]=1;
            j++;
            if (ans<j-i) {
                ans=j-i;
            }
          
        }
        else {
            table[s[i]]=0;
            i++;
        }
    }
    return ans;
}

#define max(a, b) ((a)>(b)?(a):(b))
int lengthOfLongestSubstring(char * s){
      int n =strlen(s);
     int ans = 0;
      int table[256]={0};
    for (int j = 0, i = 0; j < n; j++) {
        int tem= table[s[j]];
        i=  max(tem, i);
        ans = max(ans, j-i+1);
        table[s[j]] = j + 1;
    }
    return ans;
}



